nginx version: nginx/1.24.0 (Ubuntu)
server {
    listen 80;
    listen [::]:80;
    server_name nextmavens.cloud www.nextmavens.cloud;
    return 301 https://$server_name$request_uri;
# Include project-specific Studio configurations
include /etc/nginx/sites-available/studio-projects.conf;

}

server {
    listen 443 ssl http2;
    listen [::]:443 ssl http2;
    server_name nextmavens.cloud www.nextmavens.cloud;

    ssl_certificate /etc/letsencrypt/live/nextmavens.cloud/fullchain.pem;
    ssl_certificate_key /etc/letsencrypt/live/nextmavens.cloud/privkey.pem;
    ssl_protocols TLSv1.2 TLSv1.3;
    ssl_prefer_server_ciphers on;
    ssl_session_timeout 1d;
    ssl_session_cache shared:SSL:50m;
    ssl_stapling on;
    ssl_stapling_verify on;

    # Supabase Studio - proxy /studio/* requests to Studio container
    # Strip /studio prefix and pass remaining path to Studio


    # Proxy all other requests to Kong Gateway
    location / {
        proxy_pass http://127.0.0.1:8000;
        proxy_http_version 1.1;
        proxy_set_header Upgrade $http_upgrade;
        proxy_set_header Connection 'upgrade';
        proxy_set_header Host $host;
        proxy_cache_bypass $http_upgrade;
        proxy_set_header X-Real-IP $remote_addr;
        proxy_set_header X-Forwarded-For $proxy_add_x_forwarded_for;
        proxy_set_header X-Forwarded-Proto $scheme;
        proxy_set_header X-Forwarded-Host $host;
        proxy_set_header X-Forwarded-Port $server_port;

        # WebSocket support
        proxy_read_timeout 86400;
        proxy_send_timeout 86400;
    }
# Include project-specific Studio configurations
include /etc/nginx/sites-available/studio-projects.conf;

}

